        $this->assertNotEquals($this->getMockBuilder(TrustedClientRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTrustedClientOrDefault(SecurityScopeTrustedClientVO::from($trustedClientOtherValue))->value());
