        $this->assertNotEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['other'])->getMock(), $value->getRelyingPartyOrDefault(SecurityScopeRelyingPartyVO::from($relyingPartyOtherValue))->value());
