        $this->assertNotEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['one'])->getMock(), $value->getRelyingPartyOrDefault(SecurityScopeRelyingPartyVO::from($relyingPartyOtherValue))->value());
